PiggyBankSoya.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PiggyBankSoya {
    address public owner;

    struct Deposit {
        address sender;
        uint256 amount;
    }

    Deposit[] public depositHistory;

    constructor() {
        owner = msg.sender;
    }

    receive() external payable {
        depositHistory.push(Deposit(msg.sender, msg.value));
    }

    function getBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function getAllDeposits() public view returns (Deposit[] memory) {
        return depositHistory;
    }

    function withdraw() public {
        require(msg.sender == owner, "Access denied: Not the owner.");
        uint balance = address(this).balance;
        require(balance > 0, "Nothing to withdraw.");
        payable(owner).transfer(balance);
    }
}

